    "2016-07-25T20:56:20.576414",nt"name": "channel-islands-kelp-forest-monitoring-survey-random-point-contact",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset from the Channel Islands National
    Park's Kelp Forest Monitoring Program has estimates of substrate composition and
    percent cover of selected algal and invertebrate taxa. The data summary data presented
    here represents the mean percent cover of the indicator species at the site. Sampling
    is conducted annually between the months of May-October, so the Time data in this
    file is July 1 of each year (a nominal value). The actual measurements were taken
    at various depths, so the Depth data in this file is the depth of the station's
    temperature logger, which is a typical depth.",nt"license_title": null,nt"extras":
